import React from 'react'
import {Howl, Howler} from 'howler';
import './App.css';

var sound = new Howl({
  src: ['sound.mp3']
});

sound.play();

function App() {
  return (
    <div className="main">
      <video 
        className="video"
        autoPlay
      />

      <div className="control">
        <button className="btn">Train 1</button>
        <button className="btn">Train 2</button>
        <button className="btn">Run</button>
      </div>
    </div>
  );
}

export default App;
